css:
.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 8px 24px;
  text-align: center;
  font-weight: 600;
  color: #53596a;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid #2a2f38;
  background-color: #181d23;
}
.github-tab-icon {
  color: #323742;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #20272f;
  border-radius: 0px;
  padding: 0 .25em;
  margin-left: 8px;
}
.github-tab.react-tabs__tab--selected {
  color: #b7c5d3;
  box-shadow: 0 1px 0 #374753;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #666d81;
}
